import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import MainComponent from "./components/MainComponent";
import {BrowserRouter as Router} from "react-router-dom";


function App() {

  return (
    <div className="App">

              <Router>
                  <MainComponent/>
              </Router>

    </div>
  );
}

export default App;
